import Nav from "./component/Nav";
import './App.scss'
import Sidebar from "./component/Sidebar";
import Middlebar from "./component/Middlebar";
import Feeds from "./component/Feeds";
function App() {
  return (
<>
<Nav/>
<div className="row">
  <div className="col lineright" style={{width:"5%",minHeight:"87.7vh"}}><Sidebar/></div>
  <div className="col" style={{width:"25%",width:"70%",height:"85vh",overflowY:"scroll"}}><Middlebar/></div>
  <div className="col" style={{width:"70%"}}><Feeds/></div>
</div>

</>
  );
}

export default App;
